import React from "react";

const CreateNote = () => {
  return (
    <>
      <div className="main_note">
        <form>
          <input type="text" placeholder="Title" />
          <textarea cols="30" rows="10">
            Write a Note
          </textarea>
        </form>
      </div>
    </>
  );
};

export default CreateNote;
